(window["webpackJsonp"]=window["webpackJsonp"]||[]).push([["forum"],{5916:function(n,i,a){"use strict";a.r(i);var t=function(){var n=this,i=n.$createElement,a=n._self._c||i;return a("div",{staticClass:"terms page"},[a("Header"),a("section",{staticClass:"terms__top"},[a("div",{staticClass:"container"},[a("h1",{domProps:{innerHTML:n._s(n.api.title)}})])]),a("section",{staticClass:"terms__content"},[a("div",{staticClass:"container"},[a("div",{domProps:{innerHTML:n._s(n.api.text)}})])]),a("Footer")],1)},e=[],o=a("0418"),l=a("fd2d"),s={ru:{title:"МИИФ",text:'\n      <h5 class="text-center mb-3"><strong>«МЕЖДУНАРОДНЫЙ ИННОВАЦИОННЫЙ ИНВЕСТИЦИОННЫЙ ФОРУМ»</strong></h5>\n      <p>\n        Дата и место проведения форума: 3 - 7 ноября 2020 г., онлайн платформа InnoWeek.Uz.\n      </p>\n      <p>\n       В рамках Международной недели инновационных идей прошел «Международный инновационный инвестиционный форум», состоящий из шести сессий:\n      </p>\n      <p>\n        I. Перспективы развития искусственного интеллекта в стране;\n      </p>\n      <p>\n        II. Перспективы развития возобновляемых источников энергии в Республике Узбекистан, в том числе водородной энергетики;\n      </p>\n      <p>\n        III. Модернизация национальной системы инновационного развития Республики Узбекистан;\n      </p>\n      <p>\n        IV. Улучшение позиций Республики Узбекистан в Глобальном инновационном индексе;\n      </p>\n      <p>\n        V. Решение проблем, экологические инновации и перспективы развития технологий в регионе Аральского моря;\n      </p>\n      <p>\n        VI. Развитие стартап-инновационной экосистемы в стране и ее перспективы на будущее.\n      </p>\n      <p>Ряд презентаций на онлайн платформе провели:</p>\n      <ul class="wyif__list">\n        <li>\n          Азимжон Назаров (Министерство инновационного развития Республики\n          Узбекистан);\n        </li>\n        <li>Тим Кесслер и Пол Унгер (компания Siemens);</li>\n        <li>Арчундия Пинеда (компания Bayer AG);</li>\n        <li>Ерали Бексултан - представитель Всемирного банка;</li>\n        <li>Кирти Лал Кала (SUN Group);</li>\n        <li>Другие Международные эксперты.</li>\n      </ul>\n    ',link:"Перейти"},uz:{title:"XIIF",text:"\n      <h5 class=\"text-center mb-3\"><strong>\"Xalqaro innovatsion investitsion forum\"</strong></h5>\n      <p>\n        Forum o'tkaziladigan sana va joy: 2020 yil 3 - 7 noyabr, InnoWeek.Uz onlayn platformasi.\n      </p>\n      <p>\n        Xalqaro innovatsion g'oyalar haftaligi doirasida oltita sessiyadan iborat Xalqaro innovatsion investitsiya forumi bo'lib o'tadi:\n      </p>\n      <p>I. Mamlakatda sun'iy intellektni rivojlantirish istiqbollari;</p>\n      <p>\n        II. O'zbekiston Respublikasida qayta tiklanadigan energiya manbalarini, shu jumladan vodorod energiyasini rivojlantirish istiqbollari;\n      </p>\n      <p>\n        III. O'zbekiston Respublikasining innovatsion rivojlanish milliy tizimini modernizatsiya qilish;\n      </p>\n      <p>\n        IV. Global innovatsiyalar indeksida O'zbekiston Respublikasining mavqeini yaxshilash;\n      </p>\n      <p>\n        V. Orol dengizi mintaqasida muammolarni hal qilish, ekologik innovatsiyalar va texnologiyalarni rivojlantirish istiqbollari;\n      </p>\n      <p>\n        VI. Mamlakatda startap innovatsion ekotizimini rivojlantirish va uning istiqbollari.\n      </p>\n      <p>Onlayn platformadagi bir qator taqdimotlar:</p>\n      <ul class=\"wyif__list\">\n        <li>\n          Azimjon Nazarov (O'zbekiston Respublikasi Innovatsion rivojlanish\n          vazirligi);\n        </li>\n        <li>Tim Kessler va Pol Unger (Simens);</li>\n        <li>Archundia Pineda (Bayer AG);</li>\n        <li>Erali Beksultan - Jahon banki vakili;</li>\n        <li>Kirti Lal Kala (SUN Group);</li>\n        <li>Boshqa xalqaro ekspertlar.</li>\n      </ul>\n    ",link:"O'tish"},en:{title:"IIIF",text:'\n      <h5 class="text-center mb-3"><strong>"INTERNATIONAL INNOVATIVE INVESTMENT FORUM"</strong></h5>\n      <p>\n        Date and place of the forum: November 3 - 7, 2020, online platform InnoWeek.Uz.\n      </p>\n      <p>\n        Within the framework of the International Week of Innovative Ideas, the International Innovative Investment Forum was held, consisting of six sessions:\n      </p>\n      <p>\n        I. Prospects for the development of artificial intelligence in the country;\n      </p>\n      <p>\n        II. Prospects for the development of renewable energy sources in the Republic of Uzbekistan, including hydrogen energy;\n      </p>\n      <p>\n        III. Modernization of the national system of innovative development of the Republic of Uzbekistan;\n      </p>\n      <p>\n        IV. Improving the position of the Republic of Uzbekistan in the Global Innovation Index;\n      </p>\n      <p>\n        V. Development of a startup innovation ecosystem in the country and its future prospects.\n      </p>\n      <p>\n        VI. Development of a startup innovation ecosystem in the country and its\n        future prospects.\n      </p>\n      <p>A number of presentations on the online platform will be held by:</p>\n      <ul class="wyif__list">\n        <li>\n          Azimjon Nazarov (Ministry of Innovative Development of the Republic of\n        Uzbekistan);\n        </li>\n        <li>Tim Kessler and Paul Unger (Siemens);</li>\n        <li>Archundia Pineda (Bayer AG);</li>\n        <li>Erali Beksultan - representative of the World Bank;</li>\n        <li>Kirti Lal Kala (SUN Group);</li>\n        <li>Other International Experts.</li>\n      </ul>\n    ',link:"Visit"}},r={components:{Header:o["a"],Footer:l["a"]},computed:{api:function(){var n=this.$store.state.curLang;return s[n]}}},p=r,u=a("2877"),m=Object(u["a"])(p,t,e,!1,null,null,null);i["default"]=m.exports}}]);
